import React from 'react';
import logo from './logo.svg';
import './App.css';

function test_something () {
  window.fetch("/test").then(result => console.log(result.body))
}

function App() {
  return (
    <div className="App">
      <button onClick={test_something}>TEST BUTTON</button>
    </div>
  );
}

export default App;
